import React, { Component } from "react";
import {Redirect} from "react-router-dom";
import store from 'store';
import './body.css'
import Home from "./home";
import {Button, Form} from "react-bootstrap";


class Deleteusers extends Component
{
    constructor(props)
    {
        super(props)

    }

    render() {
        return (
            <div>

                <br/><br/><br/><br/>

            <div className="card box_shw2 border-0 px-3 rounded-2 mb-3 w_500 py-4 mx-auto mt-5">

            <form>
                    <div className="form-group">
                        <label>Choose Users to Delete</label>

                        <Form.Group id="formGridCheckbox">
                            <Form.Check type="checkbox" label="Wallet 1" />

                            <Form.Check type="checkbox" label="Wallet 2" />

                            <Form.Check type="checkbox" label="Wallet 3" />
                        </Form.Group>


                    </div>
                    <button type="submit" className="btn btn-primary btn-block">Delete Users</button>
                </form>

            </div>
            </div>
        );
    }
}

export default Deleteusers
